import { Route,Router } from "react-router-dom";
import './App.css';
import NotesListPage from './pages/NotesListPage';
import Notepage from "./pages/Notepage";

function App() {
  return (
    <Router>
    <div className="App">
     Notes
     <Route path="/" exact Component={<NotesListPage />}/>
     <Route path="note:/id" Component={<Notepage />}/>
    </div>
    </Router>
  );
}

export default App;
